[:[:DESCRIPTION:]:]
Marry Me, Clara! is a small game, but it differs from other games since you have to control both characters simultaneously. It's an alternative endless runner game. Google Play Leaderboards are implemented, so you can see how your friends did or how good you were against others.
RULES: Touch the left side of the screen to make Daniel jump. Touch the right side of the screen to make Clara jump. Both characters must NOT die. So try to avoid obstacles. Daniel can't cross the border and Clara can't touch Daniel.
TIP: Since this game fully supports multi-touch, you can play this game as multiplayer.

Good luck.

